INSERT INTO `movie` VALUES (2022,'Kantara','2D','Kannada','2 Hours 30 Min','Mystery','U/A','Rishab Shetty','Rishab Shetty, Sapthami Gowda, Sapthami Gowda','It involves culture of Kambla and Bhootha Kola. A human and nature conflict where Shiva is the rebellion who works against nature. A loop leads to war between villagers and evil forces. Will he able to replace peace in the village?','Images/kantara.jpg','2022-10-06'),(2023,'Brahmastra','3D','Hindi','2 Hours 30 Min','Fantasy','U/A','Ayan Mukerji','Amitabh Bachchan, Ranbir Kapoor, Alia Bhatt, Mouni Roy, Nagarjuna Akkineni','This is the story of Shiva who sets out in search of love and self-discovery. During his journey, he has to face many evil forces that threaten our existence.','Images/brah.jpg','2022-10-01'),(2025,'Vikram Vedha','2D','Hindi','2 Hours 30 Min','Thriller','A','Gayatri, Pushkar','Saif Ali Khan, Hrithik Roshan, Radhika Apte, Rohit Saraf, Yogita Bihani','A tough police officer sets out to track down and kill an equally tough gangster.','Images/vv.jpg','2022-10-11'),(2026,'GodFather','2D','Telugu','2 Hours 30 Min','Action','U/A','Mohan Raja','Chiranjeevi, Salman Khan, Nayanthara, Satya Dev','After the death of a political leader, a mysterious man steps in to ascend the throne.','Images/gf.jpg','2022-10-06'),(2027,'Sita Ramam','2D','Telugu','2 Hours 45 Min','Drama','U','Sita Ramam','Dulquer Salmaan, Mrunal Thakur, Rashmika Mandanna, Sumanth','An orphan soldier, Lieutenant Ram\'s life changes, after he gets a letter from a girl named Sita. He meets her and love blossoms between them.','Images/sr.jpg','2022-10-03'),(2028,'Prince','2D','Tamil','2 Hours 25 Min','Comedy','U/A',' Anudeep K.V.','Sivakarthikeyan, Maria Ryaboshapka, Sathyaraj,  Premgi, Amaren, Carl A Harte','A teacher falls in love with a young British woman who works as an English teacher at the same school','Images/prince.jpg','2022-10-26'),(2029,'Ponniyin Selvan','2D','Tamil','2 Hours 30 Min','Historical','U/A',' Mani Ratnam','Vikram, Jayam Ravi, Karthi, Trisha, Jayaram, Aishwarya Rai, Sobhita Dhulipala','Vandiyathevan sets out to cross the Chola land to deliver a message from the Crown Prince Aditha Karikalan','Images/ps1.jpg','2022-10-04'),(2030,'One Piece','2D','Japanese','2 Hours 00 Min','Action','U/A','Gor Taniguchi','Ch(voice), Jim Foronda(English version), Hiroaki Hirata(voice)','For the first time ever, Uta - the most beloved singer in the world - will reveal herself to the world at a live concert. The voice that the whole world has been waiting for is about to resound.','Images/onep.jpg','2022-10-06'),(2031,'Black Adam','3D','English','3 Hours 00 Min','Action','U/A','Jaume, Collet-Serra',' Dwayne Johnson, Sarah Shahi, Viola Davis etc.','Nearly 5,000 years after he was bestowed with the almighty powers of the Egyptian gods-and imprisoned just as quickly-Black Adam (Johnson) is freed from his earthly tomb.','Images/black.jpg','2022-10-31');
